export default function Home() {
  return (
    <div className="text-center p-8">
      <h1 className="text-4xl font-bold mb-4">Welcome to DocuMorph</h1>
      <p className="text-lg">
        Compress your PDFs or convert between Word and Excel with ease.
      </p>
    </div>
  );
}
